import { useEffect, useState } from "react";
import Table from "react-bootstrap/Table";
import { fetchAllXX } from "../services/xuatXuSevice";

const TableXuatXu = (props) => {
  const [listXuatXu, setListXuatXu] = useState([]);

  useEffect(() => {
    getXanXuat();
  }, []);

  const getXanXuat = async () => {
    let res = await fetchAllXX();
    if (res && res.data && res.data.data) {
      setListXuatXu(res.data.data);
      // console.log("Data", res);
    }
  };
  console.log(listXuatXu);
  return (
    <>
      {/* <Table striped bordered hover>
        <thead>
          <tr>
            <th>Ma Xuat Xu</th>
            <th>Ten Nuoc</th>
            <th>Tinh Trang</th>
            <th>Function</th>
          </tr>
        </thead>
        <tbody>
          {listXuatXu &&
            listXuatXu.length > 0 &&
            listXuatXu.map((item, index) => {
              return (
                <tr key={`xuatXu-${index}`}>
                  <td>{item.MaXx}</td>
                  <td>{item.tenNuoc}</td>
                  <td>{item.tinhTrang}</td>
                </tr>
              );
            })}
        </tbody>
      </Table> */}
    </>
  );
};
export default TableXuatXu;
